import React, {Component} from 'react';
import Header from './components/Header';
import Project from './components/Projects';
import Footer from './components/Footer';
import logo from './imgs/dogbread.png';

class App extends Component {
  state = {
      navigation:[
      {
        id: 1,
        name: 'header',
        links: {
          projects: '#projects',
          art: '/art',
          about: '/about',
          contact: '/contact',
        }
      },
      {
        id:2,
        name: 'art',
        links: {
          illustration: '/illustration',
          grapDesign: '/graphicdesign',
          shop: 'https://ichee.bigcartel.com/',
          contact: '/contact',
        }
      }
    ],
    projects : [
      { projName: 'NookNet', year: '2020', links:[ {name:'NookNet site', linkout:'https://nooknet.net/'} ], description: 'An Animal Crossing guide for new players and old to come here to save collections, make tunes and more. HTML, CSS3, JS, Jquery, CSS Grids, PHP, Symphony, Composer' },
      { projName: 'Classic Vacations', year: '2019-cont.', links:[ { name: 'Style Guide site', linkout:'http://classicvacationsdesign.com/' }, {name: 'Classic Vacations site', linkout: 'https://www.classicvacations.com/'} ], description: 'Created a style guide with the UX designer to help the rest of the team keep a uniformity for the new website look. Used HTML, CSS3, JS, PHP'}
    ]
  }
  render() {
    return (
      <div className="App">
        <Header navigation={this.state.navigation}/>
        <section className = "main-container">
          <div className="inner-box">
            <div className="title"><h3>hi, my name's</h3>
              <span className="name">cecilia tran.</span>
              <p><span className="stylize">Full Stack Dev</span> (specializing in front-end) & <span className="stylize">UI/UX designer</span> hybrid</p>
              <div className="divider"></div>
            </div>
            <div className="about">
                <h3>~ About Me ~</h3>
                <p>Located in California.</p>
                {/* <p>Currently a Web Developer working at <b>Expedia</b>.</p> */}
                <p>Enjoys <b>coding</b>, <i>drawing</i>, <u>designing</u>, taking photos, games and puzzles </p>
                <p>Focusing on web/mobile responsive app development and product design.</p>
            </div>
          </div>
        </section>
        <Project projects={this.state.projects}/>
        <Footer />
      </div>
    );
  }
}

export default App;
